  const routeChange = () => {
    let path = '/chapter_2';
    navigate(path);
  }

  return (
    <div>
      <h1>Congrats</h1>
      <div className="move-on">
        <button onClick={routeChange}>Chapter 2</button>
      </div>
    </div>
  )
}
